/* eslint-disable no-unused-vars */
/* eslint-disable jsx-a11y/heading-has-content */
import StyledDetail from "./Detail.styled";

function DetailIndonesia (props) {
    const {covid} = props;
    let totalColor;

    if (covid.total > 60000) {
        totalColor = 'red';
    } else if (covid.total > 50000) {
        totalColor = 'orange';
    } else {
        totalColor = 'green';
    }
    return (
        <StyledDetail>
            <div>
            <h3>{covid.status}</h3><br></br>
            <p  style={{ color: totalColor }} >{covid.total}</p>
        </div>
        </StyledDetail>

    );
}

export default DetailIndonesia;
